// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PinkShop {
    address[10] public customers;

    modifier cakeOrders(uint256 _order) {
        require(
            _order >= 0 && _order <= 10,
            "This is the maximum number of orders per day"
        );
        _;
    }

    /// Customer places an order

    function numberOfOrders(uint256 order)
        public
        cakeOrders(order)
        returns (uint256)
    {
        customers[order] = msg.sender;

        return order;
    }

    /// Order comfirmation
    function getOrders() public view returns (address[10] memory) {
        return customers;
    }
}
